import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Youtube from './service/youtube';


const youtube = new Youtube('ddd')
ReactDOM.render(
  <React.StrictMode>
    <App Youtube ={youtube}/>
  </React.StrictMode>,
  document.getElementById('root')
);
